interface Button {}
interface _Button {
  /**A "Cancel" button, indicating that an operation should not proceed.*/ CANCEL: Button;
  /**The standard close button displayed in every dialog's title bar. This button is not explicitly
added to a dialog, and it cannot be removed.*/ CLOSE: Button;
  /**A "No" button, indicating a negative response to a question.*/ NO: Button;
  /**An "OK" button, indicating that an operation should proceed.*/ OK: Button;
  /**A "Yes" button, indicating a positive response to a question.*/ YES: Button;
}
